import { Injectable } from '@angular/core';
import { AutreInfections } from '../models/AutreInfections';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class AutreinfService {
  private apiUrl = 'https://localhost:7129/api/AutreInfections';

  constructor(private http: HttpClient) { }
  addautre(AutreInfections: AutreInfections): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', AutreInfections);

    return this.http.post<any>(`${this.apiUrl}/addautre`, AutreInfections, { observe: 'response' });
  }}
